function Heading () {
    return (
        <>
            <Video></Video>
            <CalcBody>
                
            </CalcBody>
        </>
    )
}

function Video () {
    return (
        <>
        <video style={vid} autoPlay loop muted>
            <source src="video.mp4" type="video/mp4"></source>
        </video>
        </>
    )
}

function CalcBody () {
    return (
        <>
        <div className="blur">
            <Header></Header>
            <Inputs></Inputs>
        </div>
        </>
    )
}

function Header () {
    return (
        <h1>Please input Numbers</h1>
    )
}

function Inputs () {
    return (
        <>
            <div>
                <input type="text" />
                <input type="teyt" />
            </div>

            <button>Click</button>
        </>
    )
}

function sum (x, y) {
    return x + y;
}

function sub (x, y) {
    if (x>y) {
        return x - y;
    } else {
        return y - x;
    }
}

function multiply (x,y) {
   return x * y;
}

function divide (x, y) {
    if (x>y) {
        return x / y;
    } else {
        return y / x;
    }
}
const vid = {
    width : '100%',
    // height : '100vh',
    position : 'absolute',
    top : '0',
    left : '0',
    overflow : 'hidden',
    zIndex : '1'
}

const inp = {
    width: '400px',
    height : '30px',
    backgroundColor : 'white',
}

export default Heading;
